proxies:
proxy-groups:
  - name: 🕹 select
    type: url-test
  #  include-all-providers: true
    proxies:
      - ♻️ url-test
      - 🚧 fallback
      - ⚖️ load-balance

  - name: ♻️ url-test
    type: url-test
    url: http://speed.cloudflare.com/__down?bytes=20000000
    include-all: true
    udp: true
    interval: 500
    hidden: false
    proxies:
    use:
  - name: 🚧 fallback
    type: fallback
    url: http://speed.cloudflare.com/__down?bytes=20000000
    include-all: true
    udp: true
    interval: 180
    hidden: false
    proxies:
    use:
      
  - name: ⚖️ load-balance
    type: load-balance
    strategy: round-robin
    url: http://speed.cloudflare.com/__down?bytes=20000000
    include-all: true
    udp: true
    interval: 180
    hidden: false
    proxies:
    use:

  - name: 🎯
    type: select
    proxies:
      - DIRECT
      - 🕹 select
      - ♻️ url-test
rules:
  - IP-CIDR,127.0.0.1/32,DIRECT,no-resolve
  - IP-CIDR,198.18.0.1/16,DIRECT,no-resolve
  - IP-CIDR,28.0.0.1/8,DIRECT,no-resolve
  - IP-CIDR6,::1/128,DIRECT,no-resolve
  - AND,((PROCESS-NAME,clash),(NOT,((IN-TYPE,inner)))),REJECT
  - IN-TYPE,inner,🕹 select
  - MATCH,🕹 select
